import React from 'react'
import { Link } from 'react-router-dom'
import './Header.scss'

export const Header = () => {
  return (
    <div className="Header">
      <div>Tera IPL</div>
      <div>
        <Link to="/">Home</Link>
      </div>
    </div>
  )
}
